      </li>
    </ol>

  </li>
  <li>

    <p class=""bold underline"">
      DISCLOSURE, STORAGE, AND ACCESS REQUESTS
    </p>

    <ol type=""a"">
      <li>
        <strong>Retention of PharmaNet Data.</strong> You will not store or retain PharmaNet Data in any paper files or
