          <li>
            <strong>“Information Management Regulation”</strong> means the <em>Information Management Regulation</em>,
            B.C. Reg.
            74/2015.
          </li>
          <li>
            <strong>“On-Behalf-of User”</strong> means a member of your staff who (i) requires access to PharmaNet to
